section-8/6.html.body:
Killing contracts + Modifiers
We can create a suicide function, which takes all the remaining funds and gas stored in contract:
function kill() {
    if(msg.sender == owner) {
        suicide(owner);
    }
    else {
        throw;
    }

}

This gives everything stored in the contract to the owner, or whoever the param is.
Modifiers
Instead of having if/control funcitons, we can use modifiers:
modifier onlyowner() {
    if (owner == msg.sender) {

    }
    else {
        throw;
    }
}

The modifier is used to modify function, and puts the code in function where the underscore is.
Throw rolls back the changes and gives back funds to the person that ran the function.
We can add the modifers into the end of the functions:
function setMyVariable(uint myNewVaraible) onlyowner {
    myVariable = myNewVaraible;
}

function kill() onlyowner {
    suicide(owner)
}

Testing it
So now we go to our panel in the right, we try setting the variable with the owner account, and then try with a different account.
When we try it with a different account we can see we get an error, talking about a wrong jump, this is caused by the exception.

section-8/7.html.body:
Extending / Importing contracts
It is possible to extent contracts from another contracts!
We can have another contract that has:
contract mortal {
    address owner;

    modifier onlyowner() {
        if (owner == msg.sender) {
            _;
        }
        else {
            throw;
        }
    }

    function mortal() {
        owner = msg.sender;
    }

    function kill() onlyowner {
        suicide(owner)
    }
}

Now we can inherit/extend that contract by just using the "is" keyword
contract MyContract is payable {

}

This automatically extends all the functions from one contract to the other.
That means that we can remove several functions, having a much ligher function.
Different files
And now we can actually create a different file completely, and import the other contract by using:
import "mortal.sol"

Now we have contracts, inheritance, and import statements
But we can also host our contracts in places like github and import it directly from there.
Solidity and ethereum are trying to establish a node package manager called EthPM.
We want to learn to import files.
So to import from github we use:
import "github.com/ethereum/solidity/std/mortal.sol"

We will be able to import it how we use other contracts.

